import React, { useState,useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const HousingAdd = () => {
  const navigate = useNavigate();
  const House_API = 'http://26.90.237.200:3000/admin/house/add';

  const [id, setId] = useState('');
  const [addHousePlan, setAddHousePlan] = useState('');
  const [addNumDeed, setAddNumDeed] = useState('');
  const [addLandArea, setAddLandArea] = useState(0);
  const [addArea, setAddArea] = useState(0);
  const [addPrice, setAddPrice] = useState(0);
  const [addNote, setAddNote] = useState('');
  const [addStatus, setAddStatus] = useState(0);
  const [addImage, setAddImage] = useState(null);
  const [addidFK, setAddidFK] = useState(0);

  const [zones, setZone] = useState([]);
  useEffect(() => {
    loadHouseTypes();
  }, []);
  
  const loadHouseTypes = () => {
    axios.get('http://26.90.237.200:3000/admin/house_zone/read')
      .then(response => {
        setZone(response.data);
      })
      .catch(error => {
        console.error(error);
      });
  };

  const addHouse = async () => {
    const data = {
      id: id,
      addHousePlan: addHousePlan,
      addNumDeed: addNumDeed,
      addLandArea: addLandArea,
      addArea: addArea,
      addPrice: addPrice,
      addNote: addNote,
      addStatus: addStatus,
      addImage: addImage,
      addidFK: addidFK,
    };

    try {
      const response = await axios.post(House_API, data);
      console.log(response.data);
    } catch (error) {
      console.error(error);
    }
    navigate('/Housing');
  };

  return (
    <div className="container">
      <form>
        <div className="mb-3">
          <div>
            <label htmlFor="id" className="form-label">
              รหัส
            </label>
            <input
              type="text"
              className="form-control"
              id="id"
              value={id}
              onChange={(e) => setId(e.target.value)}
            />
          </div>
          <div>
            <label htmlFor="addHousePlan" className="form-label">
              แปลนบ้าน
            </label>
            <input
              type="text"
              className="form-control"
              id="addHousePlan"
              value={addHousePlan}
              onChange={(e) => setAddHousePlan(e.target.value)}
            />
          </div>
          <div>
            <label htmlFor="addNumDeed" className="form-label">
              เลขที่โฉนด
            </label>
            <input
              type="text"
              className="form-control"
              id="addNumDeed"
              value={addNumDeed}
              onChange={(e) => setAddNumDeed(e.target.value)}
            />
          </div>
          <div>
            <label htmlFor="addLandArea" className="form-label">
              ขนาดพื้นที่
            </label>
            <input
              type="number"
              className="form-control"
              id="addLandArea"
              value={addLandArea}
              onChange={(e) => setAddLandArea(parseInt(e.target.value))}
            />
          </div>
          <div>
            <label htmlFor="addLandArea" className="form-label">
              พื้นที่ใช้สอย
            </label>
            <input
              type="number"
              className="form-control"
              id="addLandArea"
              value={addArea}
              onChange={(e) => setAddArea(parseInt(e.target.value))}
            />
          </div>
          <div>
            <label htmlFor="addPrice" className="form-label">
              ราคา
            </label>
            <input
              type="number"
              className="form-control"
              id="addPrice"
              value={addPrice}
              onChange={(e) => setAddPrice(parseInt(e.target.value))}
            />
          </div>
          <div>
            <label htmlFor="addNote" className="form-label">
              หมายเหตุ
            </label>
            <input
              type="text"
              className="form-control"
              id="addNote"
              value={addNote}
              onChange={(e) => setAddNote(e.target.value)}
            />
          </div>
          <div>
            <label htmlFor="addStatus" className="form-label">
              สถานะ
            </label>
            <input
              type="number"
              className="form-control"
              id="addStatus"
              value={addStatus}
              onChange={(e) => setAddStatus(parseInt(e.target.value))}
            />
          </div>
          <div>
            <label htmlFor="addImage" className="form-label">
              รูปภาพ
            </label>
            <input
              type="file"
              className="form-control"
              id="addImage"
              onChange={(e) => setAddImage(e.target.files[0])}
            />
          </div>
          <div>
            <label htmlFor="addidFK" className="form-label"> โซนบ้าน </label>
            <input type="number" className="form-control" id="addidFK" value={addidFK} onChange={(e) => setAddidFK(parseInt(e.target.value))}/>

              {/* Other input fields */}
        <div>
          <label htmlFor="addidFK" className="form-label">
            รหัส FK
          </label>
          <DropdownButton
            id="addidFK" title={selectedFK ? selectedFK.name : 'เลือกรหัส FK'} onSelect={(e) => setAddidFK(parseInt(e.target.value))}>
            {fkOptions.map(option => (
              <Dropdown.Item key={option.id} eventKey={option}>
                {option.name}
              </Dropdown.Item>
            ))}
          </DropdownButton>
        </div>
        {/* Add button */}

            {zones.map((zone, idx) => (
          <React.Fragment key={idx}>
            <label className="btn btn-outline-primary" id="addidFK" value={addidFK} htmlFor={`zone${zone.hz_id}`} onChange={(e) => setAddidFK(parseInt(e.target.value))}>{zone.name}</label>
          </React.Fragment>
        ))}

          </div>
        </div>
        <button type="button" className="btn btn-primary" onClick={addHouse}>
          เพิ่มบ้าน
        </button>
      </form>
    </div>
  );
};

export default HousingAdd;
